def euclidD(point1, point2):
    '''
    [list,list] -> float
    
    Calculate the Euclidean distance between two point1 and point2,
    return the value of distance.
    
    >>> euclidD([1,0],[0,1])
    1.4142135623730951
    >>> euclidD([2,0],[1,1])
    1.4142135623730951
    '''
    total = 0
    for index in range(len(point1)):
        diff = (point1[index] - point2[index]) ** 2
        total = total + diff

    euclidDistance = math.sqrt(total)
    return euclidDistance


def createCentroids(k, datadict):
    '''
    (int,dictionary) -> list
    
    Choose k points at random as the center of clusters,return k points.
    
    >>> createCentroids(6,readFile('world_equakes.csv'))
    [[93.1316, 12.3644], [142.5541, -5.7791], [121.7764, 24.1017], [142.924, -6.0589], [-178.6641, -17.8875], [146.4707, 13.8221]]
    '''
    centroids = []
    centroidCount = 0
    centroidKeys = []

    while centroidCount < k:
        rkey = random.randint(1, len(datadict)) 
        if rkey not in centroidKeys:
            centroids.append(datadict[rkey])  
            centroidKeys.append(rkey)
            centroidCount += 1
    return centroids


